import React from 'react'
import './signUp.css'
export default class SignUp extends React.Component {




    render(){
        return(

        <div className="login-page">
            <h1 > <strong> Welcome to school locator </strong> </h1>

                <div className="form">
                <form onSubmit={this.handleSubmit} className="login-form">
                  <input name = "first_name"  type="name" placeholder="username" required/>
                  <input name = "password"  type="password" placeholder="password" required/>

                  <button style={{"border-radius": "7px"}}>Sign Up</button>

                    <p className="message">Already registered? <a href="/sign-in">Sign In</a></p>
                </form>
                </div>
                <h2> <strong> </strong> </h2>
              </div>
        )
    }
}
